import React, { useState, useEffect } from 'react';
import './Navbar.css';
import portlogo from '../../img/portlogo.png';
import { Link } from 'react-scroll';

const Navbar = () => {
  const [showMenu, setShowMenu] = useState(false);

  useEffect(() => {
    const handleResize = () => {
      if (window.innerWidth > 768) {
        setShowMenu(false);
      }
    };
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const toggleMenu = () => {
    setShowMenu(!showMenu);
  };

  return (
    <div>
      <div className='n-wrapper'>
        <div className='n-left'>
          <div className='n-logo'>
            <img src={portlogo} alt='' />
          </div>
        </div>
        <div className='n-right'>
          <div className='n-list'>
            <div
              className={`n-hamburger ${showMenu ? 'active' : ''}`}
              onClick={toggleMenu}
            >
              <span></span>
              <span></span>
              <span></span>
            </div>
            <ul className={`n-menu ${showMenu ? 'active' : ''}`}>
              <li>
                <Link
                  spy={true}
                  to='Intro'
                  smooth={true}
                  className='n-item'
                  activeClass='active'
                >
                  Home
                </Link>
              </li>
              <li>
                <Link
                  spy={true}
                  to='Works'
                  smooth={true}
                  className='n-item'
                  activeClass='active'
                >
                  Works
                </Link>
              </li>
              <li>
                <Link
                  spy={true}
                  to='Process'
                  smooth={true}
                  className='n-item'
                  activeClass='active'
                >
                  Process
                </Link>
              </li>
              <li>
                <Link
                  spy={true}
                  to='Projects'
                  smooth={true}
                  className='n-item'
                  activeClass='active'
                >
                  Projects
                </Link>
              </li>
              <li>
                <Link
                  spy={true}
                  to='Contact'
                  smooth={true}
                  className='n-contact n-item'
                  activeClass='active'
                >
                  Contact
                </Link>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
